import React from 'react'

 const MessageBox=({messages})=>{

     console.log(messages)
     messages.map(me=>{
         console.log(me.msg)
     })

     {}
        return(<div>
            {
                messages.map(me=>{
                    <div>Hello</div>
                })
            }
        </div>)


}

export default MessageBox;
